"""## Medidas (Definición de Volumen, Varianza, Energía)"""

# Medida: Volumen
def volumen(img):
  return np.sum(img)

# Medida: Varianza
def varianza(imagen):
  flat_list = [item for sublist in imagen for item in sublist]
  cardE = len(flat_list)

  media = stats.mean(flat_list)

  varianza = 0
  for p in flat_list:
    varianza = varianza + (p - media)**2

  varianza = (1/cardE) * varianza

  return varianza

# Medida: Energía
def energia(img):
  nrg = 0
  width, height = img.shape
  
  for v in range(height):
    for u in range(width):
      nrg += img[u][v]**2
    
  return nrg

